import { AppBar, Toolbar } from '@mui/material';
import * as React from 'react';
import {
    Stack,
    IconButton,
    Box,
    TextField,
    ThemeProvider,
    MenuItem,
    Menu,
    Typography,
  } from "@mui/material";
import HomeIcon from '@mui/icons-material/Home';
function NavBar() {
    return(
        <AppBar>
            <Toolbar>
                <IconButton>
                    <h1>icon</h1>
                </IconButton>
                <Box sx={{ flexGrow: 1 }} >
                    <Stack direction="row" spacing={2} sx={{ justifyContent: 'flex-end' }}>
                        <IconButton>
                            <h1>icon</h1>
                        </IconButton>
                        <IconButton>
                            <h1>icon</h1>
                        </IconButton>
                    </Stack>
                </Box>
            </Toolbar>
        </AppBar>
    );
};
export default NavBar;
